import {
  Box,
  Grid,
  Container,
  Typography,
  Card,
  CardMedia,
} from "@mui/material";

import IconTypography from "../EmojiTypography/IconTypography.js";

function Photography() {
  return (
    <Container>
      {/* Heading/Introduction */}
      <Box sx={{ py: { xs: 2, sm: 4 } }}>
        <Grid container spacing={2}>
          {/* Image of Me */}
          <Grid item xs={12} sm={6}>
            <Card>
              <CardMedia
                component="img"
                height="220"
                image={require("./img/camera-min.jpg")}
                alt="Camera"
              />
            </Card>
          </Grid>
          {/* Bio */}
          <Grid item xs={12} sm={6}>
            {/* Greeting */}
            <Box sx={{ pl: { xs: 0, sm: 3 } }}>
              <Typography variant="h3" component="h3">
                Photos
              </Typography>
              {/* Facts */}
              <Box sx={{ py: { xs: 2, sm: 4 } }}>
                <Typography variant="p" component="p">
                  Starting around fall 2020, I began taking photos for fun. Here
                  are some of my favorites:
                </Typography>
                <Typography variant="p" component="p">
                  Starting around fall 2020, I began taking photos for fun. Here
                  are some of my favorites:
                </Typography>
              </Box>
            </Box>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}

export default Photography;
